function HomePage() {
  return (
    <>
      <section className="relative overflow-hidden">
        {/* Background Pulses */}
        <div className="absolute inset-0 flex justify-center items-center z-0">
          <div className="bgPulse">
            {[...Array(10)].map((_, i) => (
              <span key={i} className="block bg-blue-500 rounded-full opacity-50 w-10 h-10 m-2 animate-pulse"></span>
            ))}
          </div>
        </div>

      
        {/* Main Container */}
        <div className="flex flex-col md:flex-row items-center justify-between p-6 md:p-12 bg-gray-100 z-10 relative">
          {/* Left Side - Home Content */}
          <div className="w-full md:w-1/2 p-4">
        
          </div>

          {/* Right Side - Image with Shadow */}
          <div className="w-full md:w-1/2 p-4 relative">
            <div className="shadow-xl rounded-lg overflow-hidden">

            </div>
          </div>
        </div>

       
      </section>
    </>
  );
}

export default HomePage;
